import React from 'react'
import {SampleData} from './SampleData'
const SearchResult = () => {


    return (
        <div style = {{backgroundColor:'red'}}>
            <hr />
        <img src={SampleData.findItemsByKeywordsResponse[0].searchResult[0].item[0].galleryURL} style={ImageStyle} />
            <h1>{SampleData.findItemsByKeywordsResponse[0].searchResult[0].item[0].title}</h1>
        </div>
    )
}
const ImageStyle = {
    textAlign: 'left',
    alignContents: 'flex-start',
    alignItems:'flex-start'
}

export default SearchResult
